import React from "react";
import { cloudImg, userImg2 } from "../assets";

export const FilePreview = () => {
  return (
    <div className="bg-white rounded shadow-lg h-fit w-64 p-2 flex flex-col gap-2 ">
      <img
        src={userImg2}
        className="w-full object-cover aspect-video origin-top rounded"
        alt=""
      />
      <h2 className="text-sky-900 font-bodyFont font-semibold text-sm ">
        IMG_09
      </h2>
      <h6 className="text-gray-400 font-bodyFont text-xs">July 24, 2023</h6>
    </div>
  );
};
